import React from "react";

import classes from "./styles.module.css";

interface Props {
  title: string;
  imgContent?: any;
  background: string;
  paddingParam: string;
  boxShadowParam: string;
  onClick: () => void;
}

export const Button: React.FC<Props> = ({
  title,
  imgContent,
  background,
  paddingParam,
  boxShadowParam,
  onClick,
}) => {
  return (
    <div className={classes.container}>
      <StyledCompBtn>
        <button
          className={classes.btn}
          // style={{
          //   backgroundColor: background,
          //   padding: paddingParam,
          //   boxShadow: boxShadowParam,
          // }}
          onClick={onClick}
        >
          {title}
          {imgContent && (
            <img src={imgContent} alt="/" className={classes.img} />
          )}
        </button>
      </StyledCompBtn>
    </div>
  );
};
